/// obj : {"id":1647898280209838082,"name":"ceshi","affiliatedGrade":1,"schoolYear":1,"periodsNum":1,"coverImg":null,"status":false,"isDelete":false,"createTime":"2023-04-17T17:42:18","updateTime":null,"createUser":1,"updateUser":null,"subjectVoList":[{"id":1648489081579143169,"journalId":1647898280209838082,"journalCatalogueId":1648160805898784769,"catalogueName":"测试01-04","stem":"请阅读下面短文，掌握其大意，然后从每小题所给的 A、B、C 三个选项中，选出一个能填入空白处的最佳选项，并将其字母标号填入题前的括号内。","content":"How far do you have to go to get a cup of clean water? Maybe it is just a few 36 away. But for Jimmy Akana from Uganda, a country in Africa, getting water meant walking three miles to the nearest well (井). The water was not 37 . People might get sick after drinking it. When Ryan Hrelijac, a Canadian boy, 38 the need for clean water in Africa, he decided to do something about it. He was only six years old at that time, but he didn't let that stop him. Ryan asked his mom and dad for 39 . They said that he could do housework to earn (赚) money. After four months, Ryan had 70 dollars. He 40 that would be enough to build a well. Ryan's mom drove him to anorganization (组织) that builds wells for poor people all around the world. 41 , people at the organization told Ryan he needed to spend 2,000 dollarsbuilding a well. Ryan had to do more to raise money. Finally, Ryan raised enough money and he helped to build a well for Angolo Primary School in Uganda. Years later, Ryan set up a foundation ( 基 金 会) called Ryan's Well Foundation to help 42 the world's water problem. Now Ryan's foundation is a team of people working hard to provide (提供) safe 43 for people in poor countries.","cueWord":null,"difficultyDegree":1648218284095541250,"classify":1646439861824098307,"classifyValue":2,"classifyType":"classify_type","isSubjectivity":true,"questionType":1648210320286650369,"questionTypeStr":"complete_filling","questionTypeName":"完形填空","isDelete":false,"createTime":"2023-04-19T08:49:58","updateTime":null,"createUser":1,"updateUser