9838082,"journalCatalogueId":1648160805898784769,"catalogueName":"测试01-04","stem":"请根据对话内容，从方框内所给的选项中选出能填入空白处的最佳选项，并将其字母标号写在方框下面的横线上。选项中有两项为多余项。","content":"A: Hi, Amy. What's your plan for the weekend?B: I'm going to the children's hospital on Saturday. 31A: Interesting. So how much do they pay you?B: Oh, no. It is nothing like that. I'm a volunteer.A: A volunteer? 3 B: It means that I offer to help other people and they don't need to pay meanything.A: 33 It sounds like a waste (浪费) of time to me B: Well, it's not. To me, volunteering is a great way to get to know theworld. 34 A: Really? Um, I'm not doing anything on Saturday. Can I go with you?B: Sure, why not? 35","cueWord":null,"difficultyDegree":1648218370301071362,"classify":1646704435479547905,"classifyValue":null,"classifyType":null,"isSubjectivity":true,"questionType":1648210419502911489,"questionTypeStr":"select_filling","questionTypeName":"选择填空","isDelete":false,"createTime":"2023-04-19T08:54:15","updateTime":null,"createUser":1,"updateUser":null,"questionCount":5,"subtopicVoList":[{"id":1648490161356570625,"subjectId":1648490160765173762,"problem":"","answer":"G","sort":5,"optionsList":null},{"id":1648490161356570625,"subjectId":1648490160765173762,"problem":"","answer":"G","sort":5,"optionsList":null},{"id":1648490161356570625,"subjectId":1648490160765173762,"problem":"","answer":"G","sort":5,"optionsList":null},{"id":1648490161356570625,"subjectId":1648490160765173762,"problem":"","answer":"G","sort":5,"optionsList":null},{"id":1648490161356570625,"subjectId":1648490160765173762,"problem":"","answer":"G","sort":5,"optionsList":null},{"id":1648490161356570625,"subjectId":1648490160765173762,"problem":"","answer":"G","sort":5,"optionsList":null}],"optionsList":null},{"id":1648519195591372802,"journalId":1647898280209838082,"journalCatalogueId":1648160805898784769,"catalogueName":"测试01-04","stem":"主题语境：人与社会——历史、社会与文化","content":"magine you are choosing a house to live in. Which one would you like better: a hutong or a high building? If making the decision is too hard, try to think about it from the following three aspects (方面).(1)________Let's talk about the freezing cold winter first. Because of the different building materials, it's much colder when you live in a hutong in winter. You will need to buy a heater (加热器). While in a high building, there is no need to consider it. The heating temperature will always be comfortable for you. (2)________It certainly depends on the house you live in. High buildings tend to have better sound insulation (隔音性). But in a hutong, you can easily hear your neighbors. The house is deep in the street. You can even hear birds sing in the morning. (3)________You may live in a high building for five years and never even meet your neighbors. However, hutong neighbors are completely different. They are likely to spend time with you, such as chatting, eating, and playing games.Still can't decide? Well, it may come down to which house can make you feel happier. Whether it is a hutong or a high building, I believe it will be a good choice.","cueWord":null,"difficultyDegree":1648218284095541250,"classify":1646439861824098307,"classifyValue":2,"classifyType":"classify_type","isSubjectivity":true,"questionType":1648211600254013442,"questionTypeStr":"normal_reading","questionTypeName":"常规阅读理解","isDelete":false,"createTime":"2023-04-19T10:49:38","updateTime":null,"createUser":1,"updateUser":null,"questionCount":1,"subtopicVoList":[{"id":1648519195889168386,"subjectId":1648519195591372802,"problem":"从方框中选择能填入空白处的最佳选项。","answer":"B","sort":1,"optionsList":[{"id":1648519196874829826,"p":null,"subtopicId":1648519195889168386,"subjectId":1648519195591372802,"sequence":"A","content":"Sound"},{"id":1648519196874829827,"p":null,"subtopicId":1648519195889168386,"subjectId":1648519195591372802,"sequence":"B","content":"Neighbors"},{"id":1648519196874829828,"p":null,"subtopicId":1648519195889168386,"subjectId":1648519195591372802,"sequence":"C","content":"Temperature"}]},{"id":1648519195889168386,"subjectId":1648519195591372802,"problem":"从方框中选择能填入空白处的最佳选项。","answer":"B","sort":1,"optionsList":[{"id":1648519196874829826,"p":null,"subtopicId":1648519195889168386,"subjectId":1648519195591372802,"sequence":"A","content":"Sound"},{"id":1648519196874829827,"p":null,"subtopicId":1648519195889168386,"subjectId":1648519195591372802,"sequence":"B","content":"Neighbors"},{"id":1648519196874829828,"p":null,"subtopicId":1648519195889168386,"subjectId":1648519195591372802,"sequence":"C","content":"Temperature"}]}],"optionsList":null},{"id":1648523200749023233,"journalId":1647898280209838082,"journalCatalogueId":1648160805898784769,"catalogueName":"测试01-04","stem":"请阅读下面材料，按要求完成所给任务。","content":"How do you measure ( 测 量) happiness? Maybe health is a good way, because a famous doctor once said,“Happy people are less likely (可能的) to get sick.”It’s also easy to measure how many people feel ill or unhealthy in a country. For example, one study showed that Iceland is one of the happiest countries in the world because men and women there all live a long time. The air there is very clean and there are more doctors available to every person than many other countries in the world. However, artist Erik Krikortz feels that there are other ways of measuring happiness. Krikortz has a website (网站) and visitors can choose different happy or sad faces to show how well they sleep, their relationships with family and friends, their level of stress (压力水平), and how much physical exercise they do every day. When they finish, the website gives a result of their happiness. In his home city of Stockholm, Sweden, Krikortz also shows the results as different colored lights (灯) on the side of a large building. For example, red means the people of Stockholm are very happy, green is OK and purple means many people are sad.“A lot of people look at the building every day and see how we are,”Krikortz says. The colored lights are also useful if you feel like visiting Stockholm. For example, if the lights are red, you know the people there are feeling happy!","cueWord":null,"difficultyDegree":1648218284095541250,"classify":1646439861824098307,"classifyValue":2,"classifyType":"classify_type","isSubjectivity":false,"questionType":1648211645430861825,"questionTypeStr":"question_reading","questionTypeName":"简答阅读理解","isDelete":false,"createTime":"2023-04-19T11:05:33","updateTime":null,"createUser":1,"updateUser":null,"questionCount":6,"subtopicVoList":[{"id":1648523201659187202,"subjectId":1648523200749023233,"problem":"69. Do you live a happy life? Why or why not?","answer":null,"sort":6,"optionsList":null},{"id":1648523201659187202,"subjectId":1648523200749023233,"problem":"69. Do you live a happy life? Why or why not?","answer":null,"sort":6,"optionsList":null},{"id":1648523201659187202,"subjectId":1648523200749023233,"problem":"69. Do you live a happy life? Why or why not?","answer":null,"sort":6,"optionsList":null},{"id":1648523201659187202,"subjectId":1648523200749023233,"problem":"69. Do you live a happy life? Why or why not?","answer":null,"sort":6,"optionsList":null},{"id":1648523201659187202,"subjectId":1648523200749023233,"problem":"69. Do you live a happy life? Why or why not?","answer":null,"sort":6,"optionsList":null},{"id":1648523201659187202,"subjectId":1648523200749023233,"problem":"69. Do you live a happy life? Why or why not?","answer":null,"sort":6,"optionsList":null},{"id":1648523201659187202,"subjectId":1648523200749023233,"problem":"69. Do you live a happy life? Why or why not?","answer":null,"sort":6,"optionsList":null}],"optionsList":null},{"id":1648526043950292994,"journalId":1647898280209838082,"journalCatalogueId":1648160805898784769,"catalogueName":"测试01-04","stem":"假如你是某国际学校八年级学生Bella。针对当前青少年身体素质普遍较差、生活习惯不好等问题，最近你校“Health Care Center”的公众号在征集一些有关关爱青少年身心健康的信息，你对此活动很感兴趣。请你写一篇英语短文给该公众号留言，谈谈你的几点建议。","content":"要求：1. 短文须包含以上提示信息，可适当发挥，以使行文连贯；2. 语言表达要准确，语意要通顺、连贯；3. 词数不少于80；短文开头及结尾已给出，不计入总词数。I'm Bella from Class 2, Grade 8. We all know health is important. But how can we keep healthy? Here are my ideas.","cueWord":null,"difficultyDegree":1648218250402697218,"classify":1646439861824098308,"classifyValue":3,"classifyType":"classify_type","isSubjectivity":false,"questionType":1648211645430861831,"questionTypeStr":"writing_question","questionTypeName":"写作","isDelete":false,"createTime":"2023-04-19T11:16:51","updateTime":null,"createUser":1,"updateUser":null,"questionCount":1,"subtopicVoList":null,"optionsList":null},{"id":1648553852080910337,"journalId":1647898280209838082,"journalCatalogueId":1648160805898784769,"catalogueName":"测试01-04","stem":"Complete the summary with the correct forms of the words in the box. (There is one extra word.)","content":"Artist Warren King was 1. __________ to create a series of figurative sculptures from cardboard by his Chinese heritage. King has never received any formal art 2. __________ but has always been 3. __________ in drawing and building things. Eight years ago King began to make human figures and he has never stopped since then. King uses his 4. __________ artworks to connect to his Chinese ancestry. Many of his pieces are 5. __________ on real Chinese people that King has met.","cueWord":null,"difficultyDegree":1648218250402697218,"classify":1646439861824098307,"classifyValue":2,"classifyType":"classify_type","isSubjectivity":false,"questionType":1648210379908681729,"questionTypeStr":"select_words_filling","questionTypeName":"选词填空","isDelete":false,"createTime":"2023-04-19T13:07:22","updateTime":null,"createUser":1,"updateUser":null,"questionCount":5,"subtopicVoList":[{"id":1648553853175623682,"subjectId":1648553852080910337,"problem":"","answer":"possible","sort":5,"optionsList":null},{"id":1648553853175623682,"subjectId":1648553852080910337,"problem":"","answer":"possible","sort":5,"optionsList":null},{"id":1648553853175623682,"subjectId":1648553852080910337,"problem":"","answer":"possible","sort":5,"optionsList":null},{"id":1