s hospital on Saturday. 31A: Interesting. So how much do they pay you?B: Oh, no. It is nothing like that. I'm a volunteer.A: A volunteer? 3 B: It means that I offer to help other people and they don't need to pay meanything.A: 33 It sounds like a waste (浪费) of time to me B: Well, it's not. To me, volunteering is a great way to get to know theworld. 34 A: Really? Um, I'm not doing anything on Saturday. Can I go with you?B: Sure, why not? 35","cueWord":null,"difficultyDegree":1648218370301071362,"classify":1646704435479547905,"classifyValue":null,"classifyType":null,"isSubjectivity":true,"questionType":1648210419502911489,"questionTypeStr":"select_filling","questionTypeName":"选择填空","isDelete":false,"createTime":"2023-04-19T08:54:15","updateTime":null,"createUser":1,"updateUser":null,"questionCount":5,"subtopicVoList":[{"id":1648490161356570625,"subjectId":1648490160765173762,"problem":"","answer":"G","sort":5,"optionsList":null},{"id":1648490161356570625,"subjectId":1648490160765173762,"problem":"","answer":"G","sort":5,"optionsList":null},{"id":1648490161356570625,"subjectId":1648490160765173762,"problem":"","answer":"G","sort":5,"optionsList":null},{"id":1648490161356570625,"subjectId":1648490160765173762,"problem":"","answer":"G","sort":5,"optionsList":null},{"id":1648490161356570625,"subjectId":1648490160765173762,"problem":"","answer":"G","sort":5,"optionsList":null},{"id":1648490161356570625,"subjectId":1648490160765173762,"problem":"","answer":"G","sort":5,"optionsList":null}],"optionsList":null},{"id":1648519195591372802,"journalId":1647898280209838082,"journalCatalogueId":1648160805898784769,"catalogueName":"测试01-04","stem":"主题语境：人与社会——历史、社会与文化","content":"magine you are choosing a house to live in. Which one would you like better: a hutong or a high building? If making the decision is too hard, try to think about it from the following three aspects (方面).(1)________Let's talk about the freezing cold winter first. Because of the different building materials, it's much colder when you live in a hutong in winter. You will need to buy a heater (加热器). While in a high building, there is no need to consider it. The heating temperature will always be comfortable for you. (2)________It certainly depends on the house you live in. High buildings tend to have better sound insulation (隔音性). But in a hutong, you can easily hear your neighbors. The house is deep in the street. You can even hear birds sing in the morning. (3)________You may live in a high building for five years and never even meet your neighbors. However, hutong neighbors are completely different. They are likely to spend time with you, such as chatting, eating, and playing games.Still can't decide? Well, it may come down to which house can make you feel happier. Whether it is a hutong or a high building, I believe it will be a good choice.","cueWord":null,"difficultyDegree":1648218284095541250,"classify":1646439861824098307,"classifyValue":2,"classifyType":"classify_type","isSubjectivity":true,"questionType":1648211600254013442,"questionTypeStr":"normal_reading","questionTypeName":"常规阅读理解","isDelete":false,"createTime":"2023-04-19T10:49:38","updateTime":null,"createUser":1,"updateUser":null,"questionCount":1,"subtopicVoList":[{"id":1648519195889168386,"subjectId":1648519195591372802,"problem":"从方框中选择能填入空白处的最佳选项。","answer":"B","sort":1,"optionsList":[{"id":1648519196874829826,"p":null,"subtopicId":1648519195889168386,"subjectId":1648519195591372802,"sequence":"A","content":"Sound"},{"id":1648519196874829827,"p":null,"subtopicId":1648519195889168386,"subjectId":1648519195591372802,"sequence":"B","content":"Neighbors"},{"id":1648519196874829828,"p":null,"subtopicId":1648519195889168386,"subjectId":1648519195591372802,"sequence":"C","content":"Temperature"}]},{"id":1648519195889168386,"subjectId":1648519195591372802,"problem":"从方框中选择能填入空白处的最佳选项。","answer":"B","sort":1,"optionsList":[{"id":1648519196874829826,"p":null,"subtopicId":1648519195889168386,"subjectId":164851919